window.bookSummaryJSON = "<p>Buy a planet and disappear....</p> <p>That's all Cole wanted.</p> <p>He spent 13 years hiding on the fringes of society, piloting freighters for criminals and building a stash to do just that.</p> <p>But life happens when you're busy making plans.</p> <p>When Cole chooses to save an ejected castaway and stumbles into a crew of his own, he starts down a path that will force him to choose.</p> <p>Will Cole protect those who have become his people? Or will he slip away quietly in the night?</p> <p><b>Listen now to find out!</b></p>"; 
